import React from 'react';
import style from './TripList.module.css';
import tripListData from './TripListData.js'

import CssBaseline from '@material-ui/core/CssBaseline';
import Typography from '@material-ui/core/Typography';
import Container from '@material-ui/core/Container';

import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';


const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  },
}));


export default function FixedContainer({tripListData}) {

  const classes = useStyles();

  return (   
    <>
    {tripListData.map(item => (
      <React.Fragment key={item.id}>
      <CssBaseline />
        <Container fixed>
          <Typography component="div" className={style.fixedContainer} >
            <div className={classes.root}>
              <Grid container spacing={3}>
                <Grid item xs={6}>
                  <Paper className={classes.paper}>
                     {item.name}
                  </Paper>
                </Grid>
                <Grid item xs={6}>
                  <Paper className={classes.paper}>
                    {tripListData.map(item => {item.numberOfPeople} )}
                  </Paper>
                </Grid>
              </Grid>
            </div>
          </Typography>
        </Container>
      </React.Fragment>
    ))} 
    </>  
  );
}

